// Sonido base64 (proporcionado por el usuario)
const base64Audio3 = `
data:audio/mp3;base64,
`;
const base64Audio1 = `
data:audio/mp3;base64,
`; // Reemplaza con el sonido 2
const base64Audio2 = `
data:audio/mp3;base64,
`; // Sonido base64 original

// Mapas para controlar sonidos en reproducción
const playingSounds = new Map();

// Función para reproducir sonido basado en niveles
function playSound(country, volume) {
    if (Array.from(playingSounds.keys()).some(key => key.startsWith(country))) {
        console.log(`El sonido de ${country} ya se está reproduciendo.`);
        return;
    }

    let soundsToPlay = [];
    if (volume > 0 && volume <= 0.3) {
        soundsToPlay = [base64Audio1];
    } else if (volume > 0.3 && volume <= 0.6) {
        soundsToPlay = [base64Audio1, base64Audio2];
    } else if (volume > 0.6) {
        soundsToPlay = [base64Audio1, base64Audio2, base64Audio3];
    }

    soundsToPlay.forEach((sound, index) => {
        const audio = new Audio(sound);
        audio.volume = volume;
        audio.play();

        const soundKey = `${country}_sound${index + 1}`;
        playingSounds.set(soundKey, audio);

        audio.onended = () => {
            playingSounds.delete(soundKey);
            console.log(`Sonido ${index + 1} de ${country} finalizó.`);
        };
    });
}

// Cálculo de volumen basado en la asistencia máxima
function calculateVolume(maxAttendance) {
    const globalMaxAttendance = Math.max(
        ...Object.values(worldCupData).map(entry => entry.Attendance)
    );
    return maxAttendance / globalMaxAttendance;
}

// Inicializa el sistema Aruco
Aruco.start(30, 2); 
Aruco.showPreview({ top: 100, left: 100, width: 640, height: 360 });

// Detecta marcadores Aruco
Aruco.onData((data) => {
    const detectedMarkers = Object.keys(data);

    detectedMarkers.forEach((markerId) => {
        const country = arucoMarkers[markerId];
        if (country) {
            const hostYears = Object.keys(worldCupData).filter(year =>
                worldCupData[year].Host.includes(country)
            );

            const maxAttendance = Math.max(...hostYears.map(year => worldCupData[year].Attendance));
            const volume = calculateVolume(maxAttendance);

            console.log(`País detectado: ${country}`);
            playSound(country, volume);

            Protobject.send(country).to('main.js');; // Notifica al módulo main.js
        } else {
            console.warn(`Marcador ${markerId} no asignado a ningún país.`);
        }
    });
});